    "decription": "4 button keyfob",
    "overview": "<p>The Secure Key Fob Controller is a 4 button Z-Wave device capable to act both as primary or secondary controller. The four buttons can control other Z-Wave devices such as switches, dimmer and even door locks directly. Various options - configurable by Z-Wave configuration commands - define the actions and the commands used for this control. It is possible to use two sets of buttons (one of on\/open\/up and one for off\/closed\/down) or 4 single buttons to control 4 different groups of devices.<br \/><br \/>The controller also allows triggering scenes in a central controller. Again different modes can be configured to adapt to the various implementations of scenes in different central controllers in the market.<br \/><br \/>Control options also include special modes like 'all on\/off' or always controlling the Z-Wave device in proximity to the fob. The device supports secure communication when included with enhanced security option and when communicating to a device also supporting enhanced security option. Otherwise the device will automatically turn into normal communication. to maintain backward compatibility.<\/p>",
    "inclusion": "<p>When in factory default push Button 3 (secure) or Button 4 (normal) for one second to enter inclusion mode. <\/p> <p>The inclusion mode is indicated by a blinking green LED. From second device on you need to enter management mode\u00a0 push all four buttons together for one second - green led blinks slowly), hit button 3 ( enter primary controller functions - green led blinks faster) and then button 1 (secure) or button 2 (normal).<\/p>",
    "exclusion": "<ol><li>Enter management mode\u00a0 by push all four buttons together for one second - green led blinks slowly), <\/li> <li>hit button 3 ( enter primary controller functions - green led blinks faster) and <\/li> <li>then button 3 again.<\/li> <\/ol>",
    "wakeup": "<ol><li>Enter management mode\u00a0 by push all four buttons together for one second - green led blinks slowly), <\/li> <li>then hit button 2 .<\/li> <\/ol>",
